import React from 'react'

function Main() {
    const card = ({name:"Ahmed", Age:38 ,Cy:"EG"})
    return (
    <div className='Maincontener'>
        <div>

        <div>{card.name}</div>
        <div>{card.Age}</div>
        <div>{card.Cy}</div>
        </div>
    </div>
  )
}

export default Main
